import React,{useState} from 'react';
import logo from './logo.svg';
import './App.css';
import axios from 'axios';
function App() {

  const[poke, setPoke] = useState(()=> {
    axios.get('https://pokeapi.co/api/v2/pokemon')
    .then(res => {
      setPoke(res.data.results)
      console.log(poke);
    })
  })


  const render = () =>{
    if (poke !== undefined) {
      return poke.map(item => {
        return(
          <li>{poke.name}</li>
        )
      })
    }
  }




  return (
    <div className="App">
    <p>lol</p>
    {render()}
    </div>
  );
}

export default App;
